import React from "react";

import { Table} from "react-bootstrap";

import "./formCard.css";

import logo1 from "../../assets/LUSD.png";
import logo2 from "../../assets/Dai_logo 1.png";

const formCard = () => {
  return (
    <div className=" auction-card-container">
      <div className="auction-card-wrapper">
        <div className="card_module">
          <Table>
            <tr>
              <td className="col_left"></td>
              <td className="col_right">0.00 DAI</td>
            </tr>
            
              <tr>
                <td className="col_left"></td>
                <td className="col_right">0.00 LSD</td>
              </tr>
            
          </Table>
        </div>
      </div>
    </div>
  );
};
export default formCard;
